import styles from "./ModalZoom.module.css"
import Video from "../Videos"
import BotonIcono from "../BotonIcono"
import { useModal } from "./UseModal"
import {  AiOutlineEdit} from "react-icons/ai"


const ModalZoom = (props) => {

    const { colorPrimario, colorSecundario, titulo, id } = props.datos
    const { colaboradores, eliminarColaborador, actualizarColor, like,setColaboradorSeleccionada,isOpen, openModal, closeModal } = props
    const clase = isOpen ? "styles.Overlay":"";

    return <>
        <div className={clase}>
        <AiOutlineEdit  onClick={openModal} className={styles.eliminar} />
        {colaboradores.map((colaborador, index) => <Video
                    datos={colaborador}
                    key={index}
                    colorPrimario={colorPrimario}
                    eliminarColaborador={eliminarColaborador}
                    like={like}
                    alSeleccionarFoto={setColaboradorSeleccionada}
                    />)}

            <p>EDITAR</p>
            <BotonIcono >Cerrar</BotonIcono>
        </div>

        </>

}

export default ModalZoom
